import { useNavigate } from 'react-router-dom';

function SignUp() {
  const navigate = useNavigate();

  const handleNavigation = () => {
    navigate('/sign-up');
  };

  return (
    <button onClick={handleNavigation}>
      Sign Up
    </button>
  );
}

export default SignUp
